"use strict";(self.webpackChunktypinggear=self.webpackChunktypinggear||[]).push([[554],{554:e=>{e.exports=JSON.parse('{"categories":[{"name":"\uc18d\ub2f4 \ubc0f \uc0ac\uc790\uc131\uc5b4","sentences":[{"text":"\ucc9c \ub9ac \uae38\ub3c4 \ud55c \uac78\uc74c\ubd80\ud130 \uc2dc\uc791\ub41c\ub2e4.","source":"\ud55c\uad6d \uc18d\ub2f4"},{"text":"\ubc31\uc9c0\uc7a5\ub3c4 \ub9de\ub4e4\uba74 \ub0ab\ub2e4.","source":"\ud55c\uad6d \uc18d\ub2f4"},{"text":"\uc138 \uc0b4 \ubc84\ub987 \uc5ec\ub4e0\uae4c\uc9c0 \uac04\ub2e4.","source":"\ud55c\uad6d \uc18d\ub2f4"},{"text":"\uac00\ub294 \ub9d0\uc774 \uace0\uc640\uc57c \uc624\ub294 \ub9d0\uc774 \uacf1\ub2e4.","source":"\ud55c\uad6d \uc18d\ub2f4"},{"text":"\uc6d0\uc22d\uc774\ub3c4 \ub098\ubb34\uc5d0\uc11c \ub5a8\uc5b4\uc9c4\ub2e4.","source":"\ud55c\uad6d \uc18d\ub2f4"},{"text":"\ubc31\ubb38\uc774 \ubd88\uc5ec\uc77c\uacac\uc774\ub2e4.","source":"\uc0ac\uc790\uc131\uc5b4"},{"text":"\uacfc\uc720\ubd88\uae09\uc774\ub77c, \uc9c0\ub098\uce5c \uac83\uc740 \ubbf8\uce58\uc9c0 \ubabb\ud55c \uac83\uacfc \uac19\ub2e4.","source":"\uc0ac\uc790\uc131\uc5b4"},{"text":"\uace0\uc9c4\uac10\ub798, \uc4f4 \uac83\uc774 \ub2e4\ud558\uba74 \ub2e8 \uac83\uc774 \uc628\ub2e4.","source":"\uc0ac\uc790\uc131\uc5b4"},{"text":"\ud558\ub298\uc740 \uc2a4\uc2a4\ub85c \ub3d5\ub294 \uc790\ub97c \ub3d5\ub294\ub2e4.","source":"\uc138\uacc4 \uaca9\uc5b8"},{"text":"\uc544\ub294 \uac83\uc774 \ud798\uc774\ub2e4.","source":"\ud504\ub79c\uc2dc\uc2a4 \ubca0\uc774\ucee8"},{"text":"\uc2dc\uc791\uc774 \ubc18\uc774\ub2e4.","source":"\ud55c\uad6d \uc18d\ub2f4"},{"text":"\ub4f1\uc794 \ubc11\uc774 \uc5b4\ub461\ub2e4.","source":"\ud55c\uad6d \uc18d\ub2f4"},{"text":"\ud2f0\ub04c \ubaa8\uc544 \ud0dc\uc0b0.","source":"\ud55c\uad6d \uc18d\ub2f4"},{"text":"\ub73b\uc774 \uc788\ub294 \uacf3\uc5d0 \uae38\uc774 \uc788\ub2e4.","source":"\ud55c\uad6d \uc18d\ub2f4"},{"text":"\uc6c3\ub294 \uc5bc\uad74\uc5d0 \uce68 \ubabb \ubc49\ub294\ub2e4.","source":"\ud55c\uad6d \uc18d\ub2f4"},{"text":"\uc77c\uc11d\uc774\uc870, \ub3cc \ud558\ub098\ub85c \ub450 \ub9c8\ub9ac\uc758 \uc0c8\ub97c \uc7a1\ub294\ub2e4.","source":"\uc0ac\uc790\uc131\uc5b4"},{"text":"\uc720\uc720\uc0c1\uc885, \ube44\uc2b7\ud55c \ubb34\ub9ac\ub07c\ub9ac \uc11c\ub85c \uc5b4\uc6b8\ub9b0\ub2e4.","source":"\uc0ac\uc790\uc131\uc5b4"},{"text":"\uc5ed\uc9c0\uc0ac\uc9c0, \ucc98\uc9c0\ub97c \ubc14\uafb8\uc5b4 \uc0dd\uac01\ud574 \ubcf8\ub2e4.","source":"\uc0ac\uc790\uc131\uc5b4"},{"text":"\uc2dc\uac04\uc740 \uae08\uc774\ub2e4.","source":"\uc138\uacc4 \uaca9\uc5b8"},{"text":"\uac74\uac15\ud55c \uc2e0\uccb4\uc5d0 \uac74\uac15\ud55c \uc815\uc2e0\uc774 \uae43\ub4e0\ub2e4.","source":"\uc720\ubca0\ub0a0\ub9ac\uc2a4"}]},{"name":"\ubb38\ud559 \ubc0f \ubbf8\ub514\uc5b4","sentences":[{"text":"\uc8fd\ub294 \ub0a0\uae4c\uc9c0 \ud558\ub298\uc744 \uc6b0\ub7ec\ub7ec \ud55c \uc810 \ubd80\ub044\ub7fc\uc774 \uc5c6\uae30\ub97c.","source":"\uc724\ub3d9\uc8fc - \uc11c\uc2dc"},{"text":"\uc790\uc138\ud788 \ubcf4\uc544\uc57c \uc608\uc058\ub2e4. \uc624\ub798 \ubcf4\uc544\uc57c \uc0ac\ub791\uc2a4\ub7fd\ub2e4. \ub108\ub3c4 \uadf8\ub807\ub2e4.","source":"\ub098\ud0dc\uc8fc - \ud480\uaf43"},{"text":"\ub098\ub97c \ud0a4\uc6b4 \uac74 \ud314 \ud560\uc774 \ubc14\ub78c\uc774\ub2e4.","source":"\uc11c\uc815\uc8fc - \uc790\ud654\uc0c1"},{"text":"\ub098 \ubcf4\uae30\uac00 \uc5ed\uaca8\uc6cc \uac00\uc2e4 \ub54c\uc5d0\ub294 \ub9d0\uc5c6\uc774 \uace0\uc774 \ubcf4\ub0b4 \ub4dc\ub9ac\uc624\ub9ac\ub2e4.","source":"\uae40\uc18c\uc6d4 - \uc9c4\ub2ec\ub798\uaf43"},{"text":"\ud754\ub4e4\ub9ac\uc9c0 \uc54a\uace0 \ud53c\ub294 \uaf43\uc774 \uc5b4\ub514 \uc788\uc73c\ub7b4.","source":"\ub3c4\uc885\ud658 - \ud754\ub4e4\ub9ac\uba70 \ud53c\ub294 \uaf43"},{"text":"\uac71\uc815\ud558\uc9c0 \ub9c8\ub77c. \ubc14\ub78c\uc740 \uacc4\uc0b0\ud558\ub294 \uac83\uc774 \uc544\ub2c8\ub77c \uadf9\ubcf5\ud558\ub294 \uac83\uc774\ub2e4.","source":"\uc601\ud654 \'\ucd5c\uc885\ubcd1\uae30 \ud65c\'"},{"text":"\uc5b4\ucc28\ud53c \ub0b4\uac00 \uc120\ud0dd\ud55c \uae38\uc774\uace0, \uadf8 \uc120\ud0dd\uc5d0 \ub300\ud55c \ucc45\uc784\uc740 \ub0b4\uac00 \uc9c0\ub294 \uac81\ub2c8\ub2e4.","source":"\ub4dc\ub77c\ub9c8 \'\ubbf8\uc0dd\'"},{"text":"\uc6b8\uc9c0 \ub9c8\ub77c, \uc678\ub85c\uc6b0\ub2c8\uae4c \uc0ac\ub78c\uc774\ub2e4.","source":"\uc815\ud638\uc2b9 - \uc218\uc120\ud654\uc5d0\uac8c"},{"text":"\uac00\ub09c\ud558\ub2e4\uace0 \ud574\uc11c \uc0ac\ub791\uc744 \ubaa8\ub974\uaca0\ub294\uac00.","source":"\uc2e0\uacbd\ub9bc - \uac00\ub09c\ud55c \uc0ac\ub791 \ub178\ub798"},{"text":"\ub098\ub294 \ub098\ub8fb\ubc30, \ub2f9\uc2e0\uc740 \ud589\uc778.","source":"\ud55c\uc6a9\uc6b4 - \ub098\ub8fb\ubc30\uc640 \ud589\uc778"},{"text":"\uba3c \ud6d7\ub0a0 \ub2f9\uc2e0\uc774 \ucc3e\uc73c\uc2dc\uba74 \uadf8\ub54c\uc5d0 \ub0b4 \ub9d0\uc774 \uc78a\uc5c8\ub178\ub77c.","source":"\uae40\uc18c\uc6d4 - \uba3c \ud6c4\uc77c"},{"text":"\uc0b0\ub2e4\ub294 \uac83\uc740 \uc18d\uc73c\ub85c \uc774\ub807\uac8c \uc870\uc6a9\ud788 \uc6b8\uace0 \uc788\ub294 \uac83\uc774\ub780\ub2e4.","source":"\ud669\ub3d9\uaddc - \uc990\uac70\uc6b4 \ud3b8\uc9c0"},{"text":"\uc0ac\ub78c\uc740 \ubb34\uc5c7\uc73c\ub85c \uc0ac\ub294\uac00.","source":"\ud1a8\uc2a4\ud1a0\uc774 - \ub3d9\uba85 \uc18c\uc124"},{"text":"\ub124\uac00 \uc624\ud6c4 \ub124\uc2dc\uc5d0 \uc628\ub2e4\uba74, \ub098\ub294 \uc138\uc2dc\ubd80\ud130 \ud589\ubcf5\ud574\uc9c0\uae30 \uc2dc\uc791\ud560 \uac70\uc57c.","source":"\uc0dd\ud14d\uc950\ud398\ub9ac - \uc5b4\ub9b0 \uc655\uc790"},{"text":"\ub204\uad70\uac00\ub97c \uc0ac\ub791\ud55c\ub2e4\ub294 \uac83\uc740, \uadf8 \uc0ac\ub78c\uc758 \ubc30\uacbd\uc744 \uc0ac\ub791\ud55c\ub2e4\ub294 \uac83\uc774\ub2e4.","source":"\ud55c\uac15 - \uc18c\ub144\uc774 \uc628\ub2e4"},{"text":"\uc9c4\uc815\ud55c \uc5ec\ud589\uc740 \uc0c8\ub85c\uc6b4 \ud48d\uacbd\uc744 \ubcf4\ub294 \uac83\uc774 \uc544\ub2c8\ub77c, \uc0c8\ub85c\uc6b4 \ub208\uc744 \uac16\ub294 \ub370 \uc788\ub2e4.","source":"\ub9c8\ub974\uc140 \ud504\ub8e8\uc2a4\ud2b8"},{"text":"\uc5b4\ub978\ub4e4\uc740 \ub204\uad6c\ub098 \ucc98\uc74c\uc5d4 \uc5b4\ub9b0\uc774\uc600\ub2e4. \uadf8\ub7ec\ub098 \uadf8\uac83\uc744 \uae30\uc5b5\ud558\ub294 \uc5b4\ub978\uc740 \ubcc4\ub85c \uc5c6\ub2e4.","source":"\uc0dd\ud14d\uc950\ud398\ub9ac - \uc5b4\ub9b0 \uc655\uc790"},{"text":"\uc624\ub298 \ub0b4\uac00 \ud754\ub4e4\ub9b0\ub2e4\uace0 \ud574\uc11c \ub0b4\uc77c\uc758 \ub0b4\uac00 \ud754\ub4e4\ub9ac\ub294 \uac83\uc740 \uc544\ub2c8\ub2e4.","source":"\ud754\uae00 - \ub2e4\uc815\ud558\uac8c"}]},{"name":"\uba85\uc5b8 \ubc0f \uc778\ubb3c","sentences":[{"text":"\ub098\uc758 \uc8fd\uc74c\uc744 \uc801\uc5d0\uac8c \uc54c\ub9ac\uc9c0 \ub9c8\ub77c.","source":"\uc774\uc21c\uc2e0"},{"text":"\ubc31\uc131\uc744 \ud558\ub298\ucc98\ub7fc \uc5ec\uae30\uace0, \ud558\ub298\uc744 \uc12c\uae30\ub294 \ub9c8\uc74c\uc73c\ub85c \ubc31\uc131\uc744 \uc12c\uaca8\ub77c.","source":"\uc138\uc885\ub300\uc655"},{"text":"\ub124 \uc2dc\uc791\uc740 \ubbf8\uc57d\ud558\uc600\uc73c\ub098 \ub124 \ub098\uc911\uc740 \uc2ec\ud788 \ucc3d\ub300\ud558\ub9ac\ub77c.","source":"\uc131\uacbd - \uc6a5\uae30 8\uc7a5 7\uc808"},{"text":"\uc2e4\ud328\ub294 \uc131\uacf5\uc758 \uc5b4\uba38\ub2c8\ub2e4.","source":"\ud1a0\uba38\uc2a4 \uc5d0\ub514\uc2a8"},{"text":"\uc624\ub298\uc758 \ub098\ub97c \ub9cc\ub4e0 \uac83\uc740 \uc6b0\ub9ac \ub3d9\ub124 \uc791\uc740 \ub3c4\uc11c\uad00\uc774\uc5c8\ub2e4.","source":"\ube4c \uac8c\uc774\uce20"},{"text":"\uac00\uc7a5 \ud070 \uc704\ud5d8\uc740 \uc704\ud5d8 \uc5c6\ub294 \uc0b6\uc774\ub2e4.","source":"\uc2a4\ud2f0\ube10 \ucf54\ube44"},{"text":"\ubc30\uc6b0\ub294 \uac83\uc744 \ubd80\ub044\ub7ec\uc6cc\ud558\uc9c0 \ub9c8\ub77c.","source":"\uacf5\uc790"},{"text":"\uc778\uc0dd\uc740 \uac00\uae4c\uc774\uc11c \ubcf4\uba74 \ube44\uadf9\uc774\uc9c0\ub9cc \uba40\ub9ac\uc11c \ubcf4\uba74 \ud76c\uadf9\uc774\ub2e4.","source":"\ucc30\ub9ac \ucc44\ud50c\ub9b0"},{"text":"\uc2a4\uc2a4\ub85c\ub97c \uc874\uacbd\ud558\uba74 \ub2e4\ub978 \uc0ac\ub78c\ub3c4 \ub2f9\uc2e0\uc744 \uc874\uacbd\ud560 \uac83\uc774\ub2e4.","source":"\uacf5\uc790"},{"text":"\uc5ed\uc0ac\ub97c \uc78a\uc740 \ubbfc\uc871\uc5d0\uac8c \ubbf8\ub798\ub294 \uc5c6\ub2e4.","source":"\ub2e8\uc7ac \uc2e0\ucc44\ud638"},{"text":"\ub098\ub294 \uc0dd\uac01\ud55c\ub2e4, \uace0\ub85c \ub098\ub294 \uc874\uc7ac\ud55c\ub2e4.","source":"\ub974\ub124 \ub370\uce74\ub974\ud2b8"},{"text":"\ud3ec\uae30\ud558\uc9c0 \uc54a\ub294 \ud55c, \uc2e4\ud328\ub294 \uc5c6\ub2e4.","source":"\uc5d8\ubc84\ud2b8 \ud5c8\ubc84\ub4dc"},{"text":"\uc624\ub298 \uac77\uc9c0 \uc54a\uc73c\uba74 \ub0b4\uc77c\uc740 \ub6f0\uc5b4\uc57c \ud55c\ub2e4.","source":"\uce74\ub97c\ub85c\uc2a4 \ud478\uc5d4\ud14c\uc2a4"},{"text":"\ucd5c\uace0\uc758 \ubcf5\uc218\ub294 \uc5c4\uccad\ub09c \uc131\uacf5\uc744 \uac70\ub450\ub294 \uac83\uc774\ub2e4.","source":"\ud504\ub7ad\ud06c \uc2dc\ub098\ud2b8\ub77c"},{"text":"\uac00\uc7a5 \uc911\uc694\ud55c \uac83\uc740 \ub208\uc5d0 \ubcf4\uc774\uc9c0 \uc54a\ub294\ub2e4.","source":"\uc0dd\ud14d\uc950\ud398\ub9ac - \uc5b4\ub9b0 \uc655\uc790"},{"text":"\ub098\ub294 \uc544\uc9c1\ub3c4 \ubc30\uac00 \uace0\ud504\ub2e4.","source":"\uac70\uc2a4 \ud788\ub529\ud06c"},{"text":"\ubb34\uc9c0\ub97c \uc544\ub294 \uac83\uc774 \uace7 \uc54e\uc758 \uc2dc\uc791\uc774\ub2e4.","source":"\uc18c\ud06c\ub77c\ud14c\uc2a4"},{"text":"\ub0b4\uc77c \uc9c0\uad6c\uac00 \uba78\ub9dd\ud558\ub354\ub77c\ub3c4 \ub098\ub294 \uc624\ub298 \ud55c \uadf8\ub8e8\uc758 \uc0ac\uacfc\ub098\ubb34\ub97c \uc2ec\uaca0\ub2e4.","source":"\uc2a4\ud53c\ub178\uc790"},{"text":"\uc778\uc0dd\uc740 \uacfc\uac10\ud55c \ubaa8\ud5d8\uc774\uac70\ub098, \uc544\ub2c8\uba74 \uc544\ubb34\uac83\ub3c4 \uc544\ub2c8\ub2e4.","source":"\ud5ec\ub80c \ucf08\ub7ec"}]},{"name":"\uc9c0\uc2dd \ubc0f \uc2e4\uc6a9","sentences":[{"text":"\ub300\ud55c\ubbfc\uad6d\uc758 \uc8fc\uad8c\uc740 \uad6d\ubbfc\uc5d0\uac8c \uc788\uace0, \ubaa8\ub4e0 \uad8c\ub825\uc740 \uad6d\ubbfc\uc73c\ub85c\ubd80\ud130 \ub098\uc628\ub2e4.","source":"\ub300\ud55c\ubbfc\uad6d \ud5cc\ubc95 \uc81c1\uc870"},{"text":"\uc88b\uc740 \ucf54\ub4dc\ub294 \uc8fc\uc11d\uc774 \ud544\uc694 \uc5c6\uc744 \uc815\ub3c4\ub85c \uba85\ud655\ud574\uc57c \ud55c\ub2e4.","source":"\ud074\ub9b0 \ucf54\ub4dc"},{"text":"\ubc84\uadf8\ub294 \ucf54\ub4dc\uc5d0 \uc788\ub294 \uac83\uc774 \uc544\ub2c8\ub77c, \ud504\ub85c\uadf8\ub798\uba38\uc758 \uc0dd\uac01 \uc18d\uc5d0 \uc788\ub2e4.","source":"\ud504\ub85c\uadf8\ub798\ubc0d \uaca9\uc5b8"},{"text":"\ud6c8\ubbfc\uc815\uc74c\uc740 \ubc31\uc131\uc744 \uac00\ub974\uce58\ub294 \ubc14\ub978 \uc18c\ub9ac\ub77c\ub294 \ub73b\uc774\ub2e4.","source":"\uc5ed\uc0ac \uc0c1\uc2dd"},{"text":"\ub2e8\uc21c\ud55c \uac83\uc774 \ucd5c\uace0\ub2e4.","source":"\ud504\ub85c\uadf8\ub798\ubc0d \uc6d0\uce59"},{"text":"\ud310\ub2e4\ub294 \ud558\ub8e8\uc758 \ub300\ubd80\ubd84\uc744 \ub300\ub098\ubb34\ub97c \uba39\ub294 \ub370 \uc0ac\uc6a9\ud569\ub2c8\ub2e4.","source":"\ub3d9\ubb3c \uc0c1\uc2dd"},{"text":"\ub300\ud55c\ubbfc\uad6d\uc758 \uc218\ub3c4\ub294 \uc11c\uc6b8\ud2b9\ubcc4\uc2dc\ub2e4.","source":"\uae30\ubcf8 \uc0c1\uc2dd"},{"text":"\ub3c5\ub3c4\ub294 \ub300\ud55c\ubbfc\uad6d \uace0\uc720\uc758 \uc601\ud1a0\uc785\ub2c8\ub2e4.","source":"\uc5ed\uc0ac/\uc9c0\ub9ac"},{"text":"\ubcc0\uc218\ub294 \ub370\uc774\ud130\ub97c \uc800\uc7a5\ud558\uae30 \uc704\ud55c \uba54\ubaa8\ub9ac \uacf5\uac04\uc774\ub2e4.","source":"\ud504\ub85c\uadf8\ub798\ubc0d \uae30\ucd08"},{"text":"\ud568\uc218\ub294 \ud2b9\uc815 \uc791\uc5c5\uc744 \uc218\ud589\ud558\ub294 \ucf54\ub4dc\uc758 \uc9d1\ud569\uc774\ub2e4.","source":"\ud504\ub85c\uadf8\ub798\ubc0d \uae30\ucd08"},{"text":"\uc54c\uace0\ub9ac\uc998\uc740 \uc5b4\ub5a4 \ubb38\uc81c\ub97c \ud574\uacb0\ud558\uae30 \uc704\ud55c \uc808\ucc28\ub098 \ubc29\ubc95\uc774\ub2e4.","source":"\ucef4\ud4e8\ud130 \uacfc\ud559"},{"text":"\ubaa8\ub4e0 \uad6d\ubbfc\uc740 \uc778\uac04\uc73c\ub85c\uc11c\uc758 \uc874\uc5c4\uacfc \uac00\uce58\ub97c \uac00\uc9c0\uba70, \ud589\ubcf5\uc744 \ucd94\uad6c\ud560 \uad8c\ub9ac\ub97c \uac00\uc9c4\ub2e4.","source":"\ub300\ud55c\ubbfc\uad6d \ud5cc\ubc95 \uc81c10\uc870"},{"text":"\uc9c0\uad6c\ub294 \ud0dc\uc591\uacc4\uc758 \uc138 \ubc88\uc9f8 \ud589\uc131\uc785\ub2c8\ub2e4.","source":"\uacfc\ud559 \uc0c1\uc2dd"},{"text":"\uc138\uc0c1\uc5d0\uc11c \uac00\uc7a5 \ub192\uc740 \uc0b0\uc740 \uc5d0\ubca0\ub808\uc2a4\ud2b8 \uc0b0\uc785\ub2c8\ub2e4.","source":"\uc9c0\ub9ac \uc0c1\uc2dd"},{"text":"\uace0\ub798\ub294 \ud3ec\uc720\ub958\uc5d0 \uc18d\ud558\ub294 \ud574\uc591 \ub3d9\ubb3c\uc785\ub2c8\ub2e4.","source":"\ub3d9\ubb3c \uc0c1\uc2dd"},{"text":"\ubc18\ubcf5\ub418\ub294 \ucf54\ub4dc\ub294 \ud568\uc218\ub85c \ub9cc\ub4e4\uc5b4 \uc7ac\uc0ac\uc6a9\uc131\uc744 \ub192\uc778\ub2e4.","source":"\ud504\ub85c\uadf8\ub798\ubc0d \uc6d0\uce59"}]}]}')}}]);